import wardrobeApi from './api/wardrobeApi'
import { wardrobeAPI } from '../mock/wardrobe'

class WardrobeService {
  constructor() {
    // 在开发环境中使用mock数据，在生产环境中使用真实API
    this.api = process.env.NODE_ENV === 'development' ? wardrobeAPI : wardrobeApi
  }

  // 获取所有衣物类别
  async getCategories() {
    try {
      const response = await this.api.getCategories()
      return response.data || response
    } catch (error) {
      console.error('获取衣物类别失败:', error)
      throw error
    }
  }

  // 获取所有衣物
  async getClothingItems() {
    try {
      const response = await this.api.getClothingItems()
      return response.data || response
    } catch (error) {
      console.error('获取衣物列表失败:', error)
      throw error
    }
  }

  // 根据类别获取衣物
  async getClothingItemsByCategory(categoryId) {
    try {
      const response = await this.api.getClothingItemsByCategory(categoryId)
      return response.data || response
    } catch (error) {
      console.error('获取类别衣物失败:', error)
      throw error
    }
  }

  // 获取衣物详情
  async getClothingItemDetail(id) {
    try {
      const response = await this.api.getClothingItemDetail(id)
      return response.data || response
    } catch (error) {
      console.error('获取衣物详情失败:', error)
      throw error
    }
  }

  // 添加衣物
  async addClothingItem(item) {
    try {
      const response = await this.api.addClothingItem(item)
      return response.data || response
    } catch (error) {
      console.error('添加衣物失败:', error)
      throw error
    }
  }

  // 更新衣物信息
  async updateClothingItem(id, updates) {
    try {
      const response = await this.api.updateClothingItem(id, updates)
      return response.data || response
    } catch (error) {
      console.error('更新衣物失败:', error)
      throw error
    }
  }

  // 删除衣物
  async deleteClothingItem(id) {
    try {
      await this.api.deleteClothingItem(id)
      return true
    } catch (error) {
      console.error('删除衣物失败:', error)
      throw error
    }
  }

  // 搜索衣物
  async searchClothingItems(keyword) {
    try {
      const response = await this.api.searchClothingItems(keyword)
      return response.data || response
    } catch (error) {
      console.error('搜索衣物失败:', error)
      throw error
    }
  }
}

export default new WardrobeService()
